    "glacial-drift-aquifer",nt"isopen": false,nt"url": null,nt"notes":
    "These digital maps contain information on the altitude of the base, the extent,
    and the potentiometric surface (i.e. altitude of the water table) of the Glacial-drift
    aquifer in Kansas. The Glacial-drift aquifer consists of surficial sand and gravel
    deposits as well as sand and gravel buried beneath unconsolidated till and loess
    of Pleistocene age. The bedrock digital map was developed from 1:125,000-scale source
    information with a contour interval of 50 feet. The extent map was developed from
    1:500,000-scale source information. Included as part of the digital extent map are
    areas where older rocks crop out within the aquifer boundary (fensters) and areas
    where the glacial-drift aquifers have little or no saturated thickness. The potentiometric
    surface digital map was developed at a scale of 1:200,000- from water-level data
    collected and compiled by the Kansas Geological Survey and from data available from
    the U.S. Geological Survey's National Water Information System (NWIS). The potentiometric
    surface contour interval is 50 feet. These digital maps were produced in cooperation
    with the Kansas Water Office as part of the State Water Plan.",nt"license_title":
